{
    "jsonrpc": "2.0",
    "method": "tokens_generate",
    "params": {
        "user": "tester",
        "info": {
        	"comment": "An user able to translate, upload and delete files, and also create and remove directories, in specific sub-directoris in kleio-home",
            "api": [
                "sources",
                "kleioset",
                "files",
                "structures",
                "translations",
                "upload",
                "delete",
                "mkdir",
                "rmdir"
            ],
            "structures": "users/tester/stru",
            "sources": "sources/api_tests"
        },
        "token": "{{testadmintoken}}"
    },
    "id": {{request_id}}
}

{
    "jsonrpc": "2.0",
    "method": "generate_token",
    "params": {
        "user": "admin_user",
        "info": {
        	"comment": "An admin user with permissions to generate and revoke tokens",
            "api": [
                "generate_token","invalidate_token","invalidate_user"
            ],
            "structures": "users/limited_user/stru",
            "sources": "sources/test_translations"
        },
        "token": "{{testadmintoken}}"
    },
    "id": 1
}

